INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(9,'字段字符类型校验','1','5','1','检查字段值是否为期望的字符组成（字母、数字等）','1','0','千桐科技',1,TO_DATE('2025-07-17 11:25:00.109000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:25:00.109000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'107','检查字段值是否为期望的字符组成（字母、数字等）','• 手机号字段应为纯数字，出现“+86-138****”或“138x123”触发告警
• 物流单号字段要求仅含字母+数字，禁止中文或特殊符号
• 身份证字段只允许18位数字或带X的合法身份证号',null,'CHARACTER_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(10,'字段长度范围校验','1','5','1','检查字段长度是否在定义范围内（如11位手机号）','0','0','千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'108','检查字段长度是否在定义范围内（如11位手机号）','• 手机号字段必须为11位，过长/过短为非法\n• 银行卡号字段不得超过19位\n• 姓名字段超过50字符为异常（如自动抓取异常数据）',null,'LENGTH_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(11,'日期时间格式校验','1','5','1','检查字段是否为合法的时间格式（如yyyy-MM-dd）','0','0','千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'109','检查字段是否为合法的时间格式（如yyyy-MM-dd）','• 日期字段要求格式为yyyy-MM-dd，禁止yyyy/MM/dd或中文日期格式\n• 日期时间字段必须为yyyy-MM-dd HH:mm:ss，缺失秒或用12小时制视为非法\n• 禁止出现“0000-00-00”或“1970-01-01”作为默认占位',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(12,'数值字段精度校验','1','5','1','检查小数位数是否符合业务定义（如保留2位）','1','0','千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'110','检查小数位数是否符合业务定义（如保留2位）','• 金额字段小数点后最多保留2位，保留3位或更多为异常\n• 利率字段精度需为4位，如0.0523，不能为0.052312',null,'DECIMAL_PRECISION_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(13,'枚举值校验','1','5','1','检查字段值是否在字典或枚举集中','0','0','千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'111','检查字段值是否在字典或枚举集中','• 性别字段仅允许“男/女/未知”，出现“female”、“1”视为非法\n• 订单状态字段必须在“已下单/已付款/已发货/已取消”内',null,'ENUM_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(14,'主数据引用一致性校验','1','5','1','检查引用字段是否在主数据中存在','0','0','千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:33:54.983000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'112','检查引用字段是否在主数据中存在','• 客户ID字段在客户主数据中找不到对应记录则视为无效\n• 门店编码未能在门店主数据中匹配成功时标记为脏数据',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(15,'逻辑模型一致性校验','1','5','1','检查表结构是否与数据模型一致','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'113','检查表结构是否与数据模型一致','• 数据集字段数量多于模型定义（如多出“备用字段1~3”）则为冗余字段\n• 数据类型与模型不符，如应为decimal结果为varchar',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(16,'字段元信息完整性校验','1','5','1','检查字段是否配置必要的元信息（类型、说明等）','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'114','检查字段是否配置必要的元信息（类型、说明等）','• 字段未配置中文名称或业务定义，不利于后续治理与血缘追踪\n• 缺失字段类型定义，影响自动校验与建模',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(17,'时间字段顺序逻辑校验','1','5','1','检查多个时间字段之间的前后逻辑','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'115','检查多个时间字段之间的前后逻辑','• 订单完成时间早于创建时间为异常\n• 上岗时间应早于离职时间',null,'TIME_ORDER_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(18,'数值字段逻辑关系校验','1','5','1','检查多个数值字段之间的业务逻辑关系','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'116','检查多个数值字段之间的业务逻辑关系','• 实际付款金额不得超过应付款，否则为溢付错误\n• 销售数量不得超过库存数量',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(19,'状态字段依赖项校验','1','5','1','检查某状态下是否填写了必须字段','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'117','检查某状态下是否填写了必须字段','• 状态=已取消时，取消原因字段不能为空\n• 状态=完成时，必须填写完成时间、操作人',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(20,'互斥字段冲突校验','1','5','1','检查不能同时存在的字段值是否冲突','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'118','检查不能同时存在的字段值是否冲突','• 内部客户标志与外部客户标志只能选其一\n• 线上订单标识与线下订单标识不能同时为“是”',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(21,'敏感字段脱敏校验','1','5','1','检查敏感字段是否存在明文泄露风险','0','0','千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:36:22.259000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'119','检查敏感字段是否存在明文泄露风险','• 客户手机号展示为“138****1234”\n• 身份证号仅展示前6位和最后4位，中间脱敏\n• 银行卡号仅展示后四位，其余使用“*”替代',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(22,'必填字段非空校验','2','5','1','检查强制必填字段是否存在空值','0','0','千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'203','检查强制必填字段是否存在空值','• 用户ID、订单号、收件地址等字段不能为空\n• 财务系统中凭证编号为强制必填项',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(23,'非法占位值识别','2','5','1','检查是否使用非法占位（如N/A、-999）替代有效值','0','0','千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'204','检查是否使用非法占位（如N/A、-999）替代有效值','• 年龄字段为-1、“N/A”、NULL等值视为缺失\n• 数量字段为“-999”、“未知”表示错误占位值，需清洗',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(24,'字段组完整性校验','2','5','1','检查逻辑上应成对出现的字段是否齐全','0','0','千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'205','检查逻辑上应成对出现的字段是否齐全','• 经纬度缺一不可，否则无法定位\n• 邮箱和邮箱类型需同时填写，缺任一视为不完整',null,'GROUP_FIELD_COMPLETENESS');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(25,'整记录缺失检查校验','2','5','1','检查是否存在除主键外字段全为空的记录','0','0','千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'206','检查是否存在除主键外字段全为空的记录','• 某条记录仅有主键，其他字段全为空，应标记为垃圾数据\n• 批量导入后出现内容空壳行（仅有ID），视为无效',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(26,'条件字段完整性校验','2','5','1','检查满足某条件时，相关字段是否已填写','0','0','千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:40:24.549000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'207','检查满足某条件时，相关字段是否已填写','• 是否加班=是，则加班工时不能为空\n• 是否出差=是，则必须填写出差地点',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(27,'数值字段范围校验','3','5','1','检查字段值是否落在业务定义的合理区间','0','0','千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'306','检查字段值是否落在业务定义的合理区间','• 年龄字段不得小于0或大于120\n• 折扣字段不得超过100%，小于0也不合法',null,'NUMERIC_RANGE_VALIDATION');
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(28,'数值字段逻辑值合法校验','3','5','1','校验字段值是否违反业务规则（如库存不为负，销售额不能小于0）','0','0','千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'307','校验字段值是否违反业务规则（如库存不为负，销售额不能小于0）','• 销售额出现负值为异常，需判断是否退款未记录\n• 库存为负说明有异常出库操作',null,null);
INSERT INTO "QDATA_TEST"."ATT_AUDIT_RULE"("ID","NAME","QUALITY_DIM","TYPE","LEVEL","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK","CODE","USE_CASE","EXAMPLE","ICON_PATH","STRATEGY_KEY") VALUES(29,'数值字段异常值识别','3','5','1','检测异常的极端数值或明显错误数据','0','0','千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),'千桐科技',1,TO_DATE('2025-07-17 11:41:44.759000000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,'308','检测异常的极端数值或明显错误数据','• 薪资字段为“99999999”视为默认或错误写入\n• 年龄=200、商品价格=0.01等为极端可疑值',null,null);
