INSERT INTO "QDATA_TEST"."DPP_ETL_SQL_TEMP"("ID","NAME","TYPE","CONTENT","DESCRIPTION","VALID_FLAG","DEL_FLAG","CREATE_BY","CREATOR_ID","CREATE_TIME","UPDATE_BY","UPDATER_ID","UPDATE_TIME","REMARK") VALUES(37,'create.procedure.dm8','2','-- 创建（或替换）存储过程
CREATE OR REPLACE PROCEDURE sp_get_user_info(
    p_username   IN  VARCHAR2,      -- 输入参数：用户名
    o_id         OUT INT,           -- 输出参数：用户ID
    o_real_name  OUT VARCHAR2,      -- 输出参数：真实姓名
    o_email      OUT VARCHAR2,      -- 输出参数：邮箱
    o_phone      OUT VARCHAR2,      -- 输出参数：手机号
    o_status     OUT CHAR,          -- 输出参数：状态
    o_msg        OUT VARCHAR2       -- 输出参数：结果消息
) AS
BEGIN
    -- 初始化输出
    o_msg := ''SUCCESS'';

    -- 查询
SELECT id, real_name, email, phone, status
INTO o_id, o_real_name, o_email, o_phone, o_status
FROM t_user
WHERE username = p_username
  AND ROWNUM = 1;

-- 若未找到，抛出异常
IF o_id IS NULL THEN
        RAISE_APPLICATION_ERROR(-20001, ''用户不存在'');
END IF;

EXCEPTION
    WHEN NO_DATA_FOUND THEN
        o_msg := ''用户不存在'';
        o_id := NULL;
WHEN OTHERS THEN
        o_msg := SQLERRM;
        o_id := NULL;
END;','创建Dm8存储过程','1','0',null,null,TO_DATE('2025-07-21 09:53:15.145920000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,null,TO_DATE('2025-07-21 09:53:15.145927000','SYYYY-MM-DD HH24:MI:SS.FF9'),null);
