DELIMITER $$
CREATE OR REPLACE PROCEDURE sp_get_user_info(
    IN  p_username  VARCHAR(50),
    OUT o_id        INT,
    OUT o_real_name VARCHAR(50),
    OUT o_email     VARCHAR(100),
    OUT o_phone     VARCHAR(20),
    OUT o_status    CHAR(1),
    OUT o_msg       VARCHAR(100)
)
BEGIN
    DECLARE EXIT HANDLER FOR NOT FOUND
BEGIN
        SET o_msg = ''用户不存在'';
        SET o_id = NULL;
END;

SELECT id, real_name, email, phone, status
INTO o_id, o_real_name, o_email, o_phone, o_status
FROM t_user
WHERE username = p_username
    LIMIT 1;

SET o_msg = ''SUCCESS'';
END$$
DELIMITER ;','创建Mysql存储过程','1','0',null,null,TO_DATE('2025-07-21 09:53:15.842468000','SYYYY-MM-DD HH24:MI:SS.FF9'),null,null,TO_DATE('2025-07-21 09:53:15.842474000','SYYYY-MM-DD HH24:MI:SS.FF9'),null);
